INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES (1,1,'2018-09-06 22:22:45','Magento Open Source 1 software security patches thru June 2020','Magento Open Source 1 software security patches thru June 2020\n\nFor Magento Open Source 1.5 to 1.9, we are providing software security patches through June 2020 to ensure those sites remain secure and compliant. Visit our information page for more details about our software maintenance policy and other considerations for your business.\n\nhttps://info2.magento.com/M1OpenSource.html\n','https://info2.magento.com/M1OpenSource.html',0,0),(2,2,'2018-09-27 22:49:45','PHP 7.2 support patches are now available for Magento 1','PHP 7.2 support patches for Magento 1 are now available. It is critical you are on a supported version of PHP to ensure your site is secure and in compliance. For compatibility and download details, please visit our developer forum post.\n\nhttps://community.magento.com/t5/News-Announcements/PHP-7-2-Support-Patches-for-Magento-1-are-now-available/m-p/106999#M211','https://community.magento.com/t5/News-Announcements/PHP-7-2-Support-Patches-for-Magento-1-are-now-available/m-p/106999#M211',0,0),(3,1,'2018-11-29 04:03:26','Magento Commerce 1.9.4.0 adds PHP 7.2 support along with security enhancements – 11/28/2018','The latest release of Magento Open Source 1 adds support for PHP 7.2 and delivers important security enhancements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about these enhancements. For more information about security updates included in this version of Magento please see our Security Center: https://magento.com/security/patches/supee-10975','https://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html',0,0),(4,4,'2019-02-01 01:04:25','Free Site Assessment to Drive Conversion','Magento Commerce 2 is here and there’s no better time to evolve your eCommerce strategy. Talk to us about getting a free site assessment and migration plan. We’ll help you identify opportunities to boost conversions by as much as 35%.\n\nLearn more: http://bit.ly/2WxJ6LQ\n','http://bit.ly/2WxJ6LQ',0,0),(5,4,'2019-02-08 01:12:11','Get 6 months free of Magento Commerce 2','Still using Magento Open Source 1? Embrace the power of Magento Commerce 2 with six months of free service. We’re here to help with a complimentary site assessment and seamless migration planning.\n\nDon’t wait until it’s too late, contact us today: http://bit.ly/2G9SJKM\n','http://bit.ly/2G9SJKM',0,0),(6,4,'2019-02-13 05:41:12','Magento Open Source 1 is sunsetting. Migration assistance and funding available.','We’re sunsetting Magento Open Source 1, but a new day is dawning with Magento Commerce 2. We’ve teamed up with our trusted premiere partners to make migration a breeze for you.\n\nLearn how we can help evolve your online retail experience and drive sales growth: http://bit.ly/2WsMyXP','http://bit.ly/2WsMyXP',0,0),(7,4,'2019-02-25 21:58:09','5 Point Checklist to Drive Better Conversions','Do you support one-click checkout? Run relevant promotions? Set proper shipping expectations? Let our commerce experts analyze your site and demonstrate how Magento 2 can boost revenue and customer satisfaction. Contact us today to sign up for your free site assessment.\n\nLearn more: http://bit.ly/2WxJ6LQ','http://bit.ly/2WxJ6LQ',0,0),(8,1,'2019-03-02 03:19:27','Action required: Update Authorize.Net Direct Post from MD5 to SHA-512 – 3/1/2019','Magento\'s implementation of the Authorize.Net Direct Post payment method uses MD5 based hash, and on March 14, 2019 Authorize.net will stop supporting MD5 based hash usage. This will result in Magento merchants not being able to process payments using Authorize.Net Direct Post. To avoid disruption and to continue processing payments, merchants need to apply a patch provided by Magento and add a Signature Key (SHA-512) in the Magento Admin configuration settings. For information on applying this patch please see the Magento Help Center.\n\nhttps://support.magento.com/hc/en-us/articles/360024368392','https://support.magento.com/hc/en-us/articles/360024368392',0,0),(9,4,'2019-03-06 02:48:03','Increase Conversions with a Free Site Assessment','Magento Commerce 2 is here, and there’s no better time to evolve your eCommerce strategy. Talk to us about getting a free site assessment and migration plan. We’ll help you identify opportunities to boost conversions by as much as 35%.  \n\nLearn more: http://bit.ly/2WxJ6LQ','http://bit.ly/2WxJ6LQ',0,0),(10,4,'2019-03-14 02:21:18','Your version of Open Source 1 is sunsetting. Migration assistance available. ','We’re sunsetting Magento Open Source 1, but a new day is dawning with Magento Commerce 2. We’ve teamed up with our trusted partners to make migration a breeze for you. Learn how we can help evolve your online retail experience and drive sales growth.  http://bit.ly/2WsMyXP ','http://bit.ly/2WsMyXP ',0,0),(11,4,'2019-03-20 10:39:31','Support for your free version of Magento ends in 2020. It’s time to migrate to Magento 2 with funding assistance available.  ','Support for Magento Open Source 1 is winding down, but Magento Commerce 2 is ready to take you to the next level. And our premiere partners are here to make migration easy. Learn how we can help evolve your online retail experience and drive sales growth:  http://bit.ly/2WsMyXP ','http://bit.ly/2WsMyXP',0,0),(12,1,'2019-03-27 01:05:45','Magento Open Source 1.9.4.1 released with important security enhancements – 3/26/2019','The latest release of Magento Open Source 1 delivers important security enhancements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about these enhancements. For more information about security updates included in this version of Magento please see our Security Center: https://magento.com/security/','https://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html',0,0),(13,4,'2019-03-28 05:48:32','2019: Your Time to Join the Progressive Web App Movement ','Progressive Web App technology is enabling smarter, faster mobile shopping experiences. Forrester presents their latest findings on this next-generation technology, now available on Magento Commerce 2. Read the report and reshape your customers mobile engagement.  Learn more: http://bit.ly/2HwliDK ','http://bit.ly/2HwliDK ',0,0),(14,4,'2019-04-03 12:02:39','Support for your free version of Magento ends in 2020. It’s time to migrate to Magento 2 with funding assistance available.  ','Let’s shed light on the perception that Magento Open Source is always the cheaper option. Spoiler alert – you may be surprised. Free is more expensive than you think. Learn how Magento Commerce accelerates time to market, simplifies content creation, scales with your business and more in our myth-busting guide: http://bit.ly/2WJVUxB \n\n \n\n \n','http://bit.ly/2WJVUxB ',0,0),(15,4,'2019-05-06 04:07:17','Magento Total Cost of Opportunity Guide. Get free eBook now.','Magento provides multiple eCommerce offerings with unique benefits. The question becomes: Is your free version of Magento Open Source the best option for your business and budget? Properly evaluate the all-in costs of software, development, upkeep and support needs with this free guide: http://bit.ly/2WLcNIz ','http://bit.ly/2WLcNIz ',0,0),(16,4,'2019-05-06 04:15:41','Support for your free version of Magento ends in 2020. Sign up for your free site assessment now. ','Talk to us about getting a free site assessment and migration plan. We’ll help you identify opportunities to boost conversions by as much as 35%.  \nLearn more: http://bit.ly/2WxJ6LQ ','http://bit.ly/2WxJ6LQ ',0,0);
