INSERT INTO `review_detail` (`detail_id`, `review_id`, `store_id`, `title`, `detail`, `nickname`, `customer_id`) VALUES (51,51,1,'Good Camera','    	\r\n77 of 82 people found the following review helpful:\r\nGood Camera, October 11, 2006\r\nBy 	Steve (FL) - See all my reviews\r\nGot it yesterday. In green. Actually it\'s a shiney yellowish-green. Nice feel. Fits well in shirt pocket. Very light; particullarly compared to my Pentax Optio 550. Good, nice size LCD. Easy to use yet with nice availability of choices for customization. Well written manual (you can find online thru google) and onboard help menu. Photos come out fairly nice. Tried indoors in low light with several scene settings, outdoors, macro, and supermacro. Colors look true, fairly sharp without noticable artifact. Used in South Florida morning daylight outside without any trouble with LCD viewing (camera has no classic viewfinder). Have read reviews of washout in bright sun: have not tried that yet. Overall, I\'m happy with the camera thus far. ','Jenella',1),(52,52,1,'demo','demo','demo',NULL),(53,53,1,'demo','demo','demo',NULL),(54,54,1,'demo','demo','demo',NULL),(55,55,1,'demo','demo','demo',NULL),(56,56,1,'demo','demo','demo',NULL),(57,57,1,'demo','demo','demo',NULL),(58,58,1,'demo','demo','demo',NULL),(59,59,1,'demo','demo','demo',NULL),(60,60,1,'demo','demo','demo',NULL),(61,61,1,'demo','demo','demo',NULL),(62,62,1,'demo','demo','jame',7),(63,63,1,'Demo 2demo','demo','jame',7),(64,64,1,'demodemo','demo','jame',7),(65,65,1,'Demo 2','demo','jamedemo',7),(66,66,1,'Demo','demo','jamedemo',7),(67,67,1,'demodemo','demo','jame3',7),(68,68,1,'demo','demo','jame',7),(69,69,1,'F:\\logo','F:\\logo','jame',7),(70,70,1,'F:\\logo','F:\\logo','jame',7),(71,71,1,'F:\\logo','F:\\logo','jame',7),(72,72,1,'demo','demi','demo',4),(73,73,1,'hf','nbvcv gffg hgfh hgf  hg gfhfhh  hg hgf','fred',NULL),(74,74,2,'Fab','fagvafafaf asd ','fabio',11),(75,75,1,'test','test message','sarhov',NULL);
